# Generalized Agnesi transform: r โ y โ [-1, 1]
# Formula: s = (r-rin)/(req-rin), x = 1/(1+a*s^pin/(1+s^(pin-pcut))), y = b1*x + b0
@inline function agnesi_transform_2(r::T) where {T}
    rin = T(PAIR_2_RIN)
    req = T(PAIR_2_REQ)
    a = T(PAIR_2_A)
    b0 = T(PAIR_2_B0)
    b1 = T(PAIR_2_B1)
    pin = PAIR_2_PIN
    pcut = PAIR_2_PCUT

    # Normalized distance from rin to req
    s = (r - rin) / (req - rin)

    # Generalized Agnesi: x = 1 / (1 + a * s^pin / (1 + s^(pin-pcut)))
    s_pin = s^pin
    s_diff = s^(pin - pcut)
    x = one(T) / (one(T) + a * s_pin / (one(T) + s_diff))

    # Linear rescaling to [-1, 1]
    y = b1 * x + b0
    y = clamp(y, -one(T), one(T))

    return y
end

# Agnesi transform with analytical derivative: returns (y, dy/dr)
@inline function agnesi_transform_d_2(r::T) where {T}
    rin = T(PAIR_2_RIN)
    req = T(PAIR_2_REQ)
    a = T(PAIR_2_A)
    b0 = T(PAIR_2_B0)
    b1 = T(PAIR_2_B1)
    pin = PAIR_2_PIN
    pcut = PAIR_2_PCUT

    ds_dr = one(T) / (req - rin)
    s = (r - rin) * ds_dr

    # Avoid numerical issues at s=0
    if s <= zero(T)
        return -one(T), zero(T)
    end

    s_pin = s^pin
    s_diff = s^(pin - pcut)
    denom = one(T) + s_diff

    x = one(T) / (one(T) + a * s_pin / denom)
    y = b1 * x + b0
    y = clamp(y, -one(T), one(T))

    # Derivative: dx/ds using quotient rule on x = 1/(1 + a*s^pin/(1+s^(pin-pcut)))
    # Let g = a * s^pin / (1 + s^(pin-pcut))
    # x = 1/(1+g), so dx/dg = -1/(1+g)^2 = -x^2
    # dg/ds = a * (pin*s^(pin-1) * (1+s^(pin-pcut)) - s^pin * (pin-pcut)*s^(pin-pcut-1)) / (1+s^(pin-pcut))^2
    #       = a * s^(pin-1) * (pin*(1+s^(pin-pcut)) - (pin-pcut)*s^(pin-pcut)) / (1+s^(pin-pcut))^2
    #       = a * s^(pin-1) * (pin + pin*s^(pin-pcut) - pin*s^(pin-pcut) + pcut*s^(pin-pcut)) / (1+s^(pin-pcut))^2
    #       = a * s^(pin-1) * (pin + pcut*s^(pin-pcut)) / (1+s^(pin-pcut))^2
    g = a * s_pin / denom
    dg_ds = a * s^(pin-1) * (pin + pcut * s_diff) / (denom^2)
    dx_ds = -x^2 * dg_ds

    dy_ds = b1 * dx_ds
    dy_dr = dy_ds * ds_dr

    return y, dy_dr
end

# Envelope function: (1 - yยฒ)ยฒ in Y-SPACE
# This is the standard ACE quartic envelope
@inline function envelope_2(y::T) where {T}
    # Y-space envelope: (1 - yยฒ)ยฒ
    y2 = y * y
    one_minus_y2 = max(zero(T), one(T) - y2)
    return one_minus_y2^2
end

# Envelope with derivative w.r.t. y
# d/dy[(1-yยฒ)ยฒ] = 2(1-yยฒ)(-2y) = -4y(1-yยฒ)
@inline function envelope_d_2(y::T) where {T}
    y2 = y * y
    one_minus_y2 = max(zero(T), one(T) - y2)
    env = one_minus_y2^2
    denv_dy = -4 * y * one_minus_y2
    return env, denv_dy
end

# Hermite cubic spline evaluation (values only)
@inline function evaluate_Rnl_2(r::T)::SVector{N_RNL, T} where {T}
    # Transform to y-space
    y = agnesi_transform_2(r)

    # Find segment in uniform grid
    y_clamped = clamp(y, PAIR_2_Y_MIN, PAIR_2_Y_MAX)
    t_raw = (y_clamped - PAIR_2_Y_MIN) / PAIR_2_H
    t_frac, t_floor = modf(t_raw)
    il = unsafe_trunc(Int, t_floor) + 1  # 1-indexed

    # Clamp segment index
    il = clamp(il, 1, PAIR_2_N_KNOTS - 1)

    # Get knot data (left and right endpoints of segment)
    @inbounds fl = PAIR_2_F[il]
    @inbounds fr = PAIR_2_F[il + 1]
    @inbounds gl = PAIR_2_H .* PAIR_2_G[il]   # Pre-scale by h
    @inbounds gr = PAIR_2_H .* PAIR_2_G[il + 1]

    # Hermite cubic polynomial (Horner's form)
    # f(t) = ((a3*t + a2)*t + a1)*t + a0
    # where:
    #   a0 = fl
    #   a1 = gl
    #   a2 = -3fl + 3fr - 2gl - gr
    #   a3 = 2fl - 2fr + gl + gr
    a0 = fl
    a1 = gl
    a2 = @. -3fl + 3fr - 2gl - gr
    a3 = @. 2fl - 2fr + gl + gr
    s = @. ((a3 * t_frac + a2) * t_frac + a1) * t_frac + a0

    # Apply envelope in Y-SPACE: (1 - yยฒ)ยฒ
    env = envelope_2(y)
    return env .* s
end

# Hermite cubic spline evaluation (with derivatives)
@inline function evaluate_Rnl_d_2(r::T)::Tuple{SVector{N_RNL, T}, SVector{N_RNL, T}} where {T}
    # Transform to y-space (with analytical derivative)
    y, dy_dr = agnesi_transform_d_2(r)

    # Find segment
    y_clamped = clamp(y, PAIR_2_Y_MIN, PAIR_2_Y_MAX)
    t_raw = (y_clamped - PAIR_2_Y_MIN) / PAIR_2_H
    t_frac, t_floor = modf(t_raw)
    il = unsafe_trunc(Int, t_floor) + 1

    il = clamp(il, 1, PAIR_2_N_KNOTS - 1)

    # Get knot data
    @inbounds fl = PAIR_2_F[il]
    @inbounds fr = PAIR_2_F[il + 1]
    @inbounds gl = PAIR_2_H .* PAIR_2_G[il]
    @inbounds gr = PAIR_2_H .* PAIR_2_G[il + 1]

    # Hermite cubic (value)
    a0 = fl
    a1 = gl
    a2 = @. -3fl + 3fr - 2gl - gr
    a3 = @. 2fl - 2fr + gl + gr
    s = @. ((a3 * t_frac + a2) * t_frac + a1) * t_frac + a0

    # Hermite cubic derivative w.r.t. t
    # ds/dt = (3a3*t + 2a2)*t + a1
    ds_dt = @. (3a3 * t_frac + 2a2) * t_frac + a1

    # Chain rule: ds/dy = (ds/dt) / h
    ds_dy = ds_dt ./ PAIR_2_H

    # Envelope in Y-SPACE and its derivative w.r.t. y
    env, denv_dy = envelope_d_2(y)

    # Product rule with chain rule: d/dr[env(y) * s(y)]
    #   = (denv/dy * s + env * ds/dy) * dy/dr
    Rnl = env .* s
    dRnl_dr = (denv_dy .* s .+ env .* ds_dy) .* dy_dr

    return Rnl, dRnl_dr
end

# === Pair 3: Species (2, 1) ===

const PAIR_3_PIN = 2
const PAIR_3_PCUT = 2
const PAIR_3_A = 0.6666666666666666
const PAIR_3_B0 = 2.6680991735537187
const PAIR_3_B1 = -3.6680991735537187
const PAIR_3_RIN = 0.0
const PAIR_3_REQ = 2.9

const PAIR_3_Y_MIN = -1.0
const PAIR_3_Y_MAX = 1.0
const PAIR_3_N_KNOTS = 50
const PAIR_3_H = 0.04081632653061224  # Knot spacing

